import React from 'react';
import { Box, Button, Heading, Grommet, Header, Paragraph, Avatar, Image } from 'grommet';
import { Home, Book, Contact } from 'grommet-icons';

const theme = {
  global: {
    colors: {
      brand: '#116466',
    },
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

function App() {

  function AppBar() {
    return (
      <Header background="brand">
        <Box direction="column" pad={{left: 'medium'}} align='center'>
          Fuad Sahmawi
        </Box>
        <Box direction = 'row' pad={{ right: 'medium', left: 'small', vertical: 'small' }}>
          <Button icon={<Home />} onClick={() => {}} />
          <Button icon={<Book />} onClick={() => {}} />
          <Button icon={<Contact />} onClick={() => {}} />
        </Box>
      </Header>
    );
  };

  return (
    <Grommet theme={theme} full>
    <Box fill>
      <AppBar/>
      <Box direction='row' flex overflow={{ horizontal: 'hidden' }}>
        <Box flex align='center' justify='start' pad='medium'>
          <Heading level='2'>Hello, I'm Fuad, a Software Developer.</Heading>
          <Image src="images/displaypic.png" />
          <Heading level='3'>About</Heading>
          <Paragraph>
            I graduated from the National University of Singapore (NUS) in 2020 majoring in Computer Engineering.
            I currently work at DBS as a Technology Executive (SEED).
          </Paragraph>
        </Box>  
      </Box>
    </Box>
    </Grommet>
  );
}

export default App;
